import React from "react";
import {Grid} from "@material-ui/core";
import {spacing} from "@material-ui/system";


const Logo = () => (
    <Grid
        container
        justify="space-evenly"
        alignItems="flex-start"
    >
        <Grid item sm={3}>
            <img src={require("../images/Logo1.svg")} href="#home" />
            <img src={require("../images/Logo2.svg")} href="#home" mx/>
        </Grid>
    </Grid>
)

export default Logo;
